import React, { Component } from 'react';
import MainLayout from '../../components/layouts/mainLayout';

class Users extends Component {
    render() {
        return (
            <>
                <MainLayout>
                    <h1>Welcome to the users page</h1>
                </MainLayout>
            </>
        )
    }
}

export default Users;
